      'x-api-key':'45N0Ujae7p9AWDs3ihDiU4ZDnvAMb9ZK4TXH0kCk',
      'content-type': 'application/json',
  
      'Authorization': `Bearer ${token}`
    }
    
    const response = await fetch(
       "https://api.raspi-geek.com/v1/latestorder",
       
       { method: "GET",headers }
    );
    const ajson = await response.json();
    setLatestTransaction(ajson.Records)

  }
  return (
    <div>
      <h2 className="title gx-mb-4"><IntlMessages id="sidebar.listWajibPajak"/></h2>

      <div className="gx-d-flex justify-content-center">
        <h4>ListWajibPajak!</h4>
      </div>
     
      
    </div>
  );
};

export default ListWajibPajak;
